import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.js'; // Adjust the path based on your actual file structure
import UserSettingsProvider from './components/UserSettingsProvider.js';
import withTimeTracker from './css/WithTimeTracker';

const AppWithTimeTracker = withTimeTracker(App);

ReactDOM.render(
  <React.StrictMode>
    <UserSettingsProvider>
      <AppWithTimeTracking />
    </UserSettingsProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
